pragma solidity ^0.4.0;

import "./TicTacToeLogic.sol";

contract TicTacToe is TicTacToeLogic {
  constructor(address registrarAddress) public EDGBase(1001) HasRegistrar(registrarAddress) {}

  function getGameId() public view returns (uint gameId) {
    return playerToGameId[msg.sender];
  }

  function getGameForUser()
    public
    view
    returns (uint gameId, uint32 price, uint16 maxPlayers, uint64[] dragons, uint64[] winners, uint8 status)
  {
    gameId = playerToGameId[msg.sender];
    (price, maxPlayers, dragons, winners, status) = getGame(gameId);
  }

  function getCellValue(uint256 _gameId, uint8 row, uint8 col) public view returns (uint8) {
    return gameInfos[_gameId].cells[col][row];
  }

  function getPlayingField(uint256 _gameId) public view returns (uint8[SIZE][SIZE]) {
    return gameInfos[_gameId].cells;
  }
}
